import React, { Component } from 'react';

import shirt1 from '../images/shirt1.png'
import shirt2 from '../images/shirt2.png'
import shirt3 from '../images/shirt3.png'



const productData = [
	{
		name:"Men's Knitwear Offers",
		image:shirt1
	},
	{
		name:"Mens Sweat Shirt",
		image:shirt2
	},
	{
		name:"Mens Sweat Shirt",
		image:shirt3
	},

]

class Products extends Component {

	render(){

		const products = productData.map(product => {
			return (
				<div style={{backgroundColor:'white'}} className='col-4' key={product.name}>
					<img style={{width:'100%'}} src={product.image}/>
					<h6>{product.name}</h6>
				</div>
			)
		});

		return(
			<div className='container-fluid'>
	     	<div className='row'>
	     		{products}
	     		{products}
	     		{products}
	     	</div>
	     	</div>
		);
	}
}


export default Products;
